VALUES
	(1,'<strong>FDReports.com, Creditntell.com,\r\n FDArms.com</strong> - A Coldfusion site with an MSSQL backend. The second of three sites that I worked on the programming for for over 4 years with my employer Information Clearinghouse Inc.\r\n<br><br>\r\nSlide 1 above represents the redone version of the site while slide 2 is what you would see if scrolling down the page further. <br><br>\r\nSlide 3 is what the site looked like when I started working on it.\r\n\r\nThe sister sites for this business, FDARMS.COM and Creditntell.com were also similarly updated and upgraded. Below, please see the thumbnails that represent their prior version and links out the their current versions<br><br>\r\n\r\n<a href=\"http://www.creditntell.com\"><img alt=\"Creditntell\" src=\"http://finespunmusic.com/Oren/Graphics/CNT_thumb.png\" width=\"110\" height=\"110\" border=\"0\"></a>\r\n<br>\r\n<strong>Creditntell.com</strong> – A Coldfusion site with an MSSQL backend. One of three sites that I worked on the programming for for over 4 years with my employer Information Clearinghouse Inc. <a href=\"http://www.creditntell.com\">www.creditntell.com</a>\r\n\r\n\r\n<br><br>\r\n\r\n<a href=\"http://www.fdarms.com\"><img alt=\"FDArms\" src=\"http://finespunmusic.com/Oren/Graphics/FDArms_thumb.png\" width=\"110\" height=\"110\" border=\"0\"></a>\r\n<br>\r\n<strong>FDArms.com</strong> – A PHP/Flash driven site with a MySql backend. The third of three sites that I worked on the programming for for over 4 years with my employer Information Clearinghouse Inc. <a href=\"http://www.fdarms.com\">www.fdarms.com</a>','Adobe Cold Fusion, Audio, Branding, HTML/CSS, Logo Design, MSSQL, MySQL, Photoshop','<strong>FDReports.com</strong>','FD'),
	(2,'<strong>DNC.io</strong> - DNC Holdings corporate site. An HTML 5 template customization using Bootstrap and Javascript.\r\n<br><br>\r\nFrom the about section:<br><br>\r\nDNC Holdings, Inc. is a leading technology service company specializing in providing clients with strategic and operational related services in the domain name registrar, monetization, and web hosting industries.','PHP ,Jquery ,Javascript ,HTML 5 ,Bootstrap','Dnc.io','dncio'),
	(3,'<strong>Directnic.com</strong> - The main site I worked on while employed by DNC Holdings, from August 2014 to May 2017.\r\n<br><br>\r\nFrom the about section:<br><br>\r\nDNC Holding, Inc. \r\n<br><br>\r\nDNC Holdings, Inc, doing business as Directnic.com,. is an ICANN Accredited Registrar incorporated in Delaware and has a principal office in Louisiana, USA.\r\n<br><br>\r\nBut who are we, really?\r\n<br><br>\r\nSimply put, we are a team of compassionate, professional individuals dedicated to providing you with the best industry tools available to get your presence online. We live and breathe domain names, hosting, email, DNS and more!','PHP ,MySQL ,Jquery ,Javascript ,HTML 5 ,Gumby ,Bootstrap ,Web Services for EPP, Whois and other ,Github ,Piwik (for Live Chat Assistance) ,CPanel','Directnic.com','dnc'),
	(4,'<strong>Dotology.com</strong> - the sister site of Directnic.com, which I worked on from launch in 2014 to May 2017.\r\n<br><br>\r\nFrom the about section:<br><br>\r\nDotology is an independent and privately held ICANN accredited registrar (under DOT Holding, Inc.) a dying breed! We are dedicated to providing amazing service at reasonable prices for small businesses and other organizations. We’re a small business ourselves so we know the struggle and we celebrate the small victories, just like you do. Whether it’s the first dollar, the first major sale, the first referral or the first mention in local press we want to be the trusted partner you turn to time and again.','PHP ,MySQL ,Jquery ,Javascript ,HTML 5 ,Gumby ,Bootstrap ,Web Services for EPP, Whois and other ,Github ,Piwik (for Live Chat Assistance) ,CPanel','Dotology.com','dotology'),
	(5,'<strong>Vocalbrilliance.com</strong> -\r\nIt’s all about relationships and who you know. My former voice coach Dan Parilis needed a new website for his company Vocal Brilliance. I’m always happy to help out a friend!','Wordpress,\r\nMySQL,\r\nPhotoshop,Logo Design','<strong>Vocal Brilliance</strong>','vb'),
	(7,'<strong>IGCDentistry.com</strong> -\r\nContracted by Sebring Management, IGCDentistry.com is a site built for dentist Dr Tadros and his amazing staff. They offer general and cosmetic dentistry to the Central Florida area. For this project, I created 22 pages of services content pages for a stunning site that will provide information to their current and future patients.','Branding,HTML/CSS,Logo Design,PHP,User Interface,Web Development,Wordpress','<strong>IGC Dentistry</strong>','igc'),
	(8,'<strong>ACT-LI.com</strong> -\r\nFor over 8 years, I have been working via contract with Applied Computer Technologies (ACT-LI.com) on various coding projects. Most of our work is done behind the scenes in the land of coding and querying, but it has been my pleasure to work with them on such projects as Daniel Demarco & Associates CMS, Autotrader.com, and the upcoming Township GIS Mapping Project','Adobe Cold Fusion,\r\nAudio,\r\nBranding,\r\nHTML/CSS,\r\nLogo Design,\r\nMSSQL,\r\nMySQL,\r\nPhotoshop,\r\nPHP,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development,\r\nWordpress','<strong>ACT-LI.com</strong>','act'),
	(9,'<strong>DanielDemarco.com</strong> -\r\nDaniel Demarco & Associates is a company who makes freestanding and perimeter fixtures for brick and mortar retail outlets such as Mont Blanc, Van Cleef & Arpels, and Ralph Lauren to name a few. If you’ve ever gone into one of these stores and picked up a sweater off a table, its DDMA who made that table. In working with DDMA, along with ACT-LI.com, we have created an inventory tracking system for the companies entire operation. From the first design drawing to the delivery and installation of the end product, DDMA is using my software to power its day to day business needs.<br><br>\r\n\r\nThe first two slides represent their customer facing site while the third slide represents the opening page of the inventory system I created for them while working for ACT-LI.com. <br><br>More screen grabs for the inventory control system can be found on this site on the ACT-LI.com detail \r\n page <a href=\"/oren-epstein/Oe/detail/act\">here</a>','Branding,\r\nHTML/CSS,\r\nMSSQL,\r\nMySQL,\r\nUser Interface,\r\nWeb,\r\nWeb Development','<strong>DanielDemarco.com</strong>','ddma'),
	(10,'<strong>Stretch The Skies</strong> -\r\n<br>\r\nI handled day to day operations for them as well as web design, backend scripting, customer and technical support, graphic design projects and more, please see resume for details.www.stretchtheskies.com Sadly this domain has expired and the business closed down, but before it did, STS ran the Localeyez program of which I was deeply involved in with the folks at Transworld Entertainment, thusly providing graphics and copy that would appear in the Transworld family of stores; Including but not limited to Coconuts, The Wall, FYE stores.','Audio,\r\nBrand Ambassador at Events,\r\nBranding,\r\nCustomer Service,\r\nHTML/CSS,\r\nLogo Design,\r\nMSSQL,\r\nMySQL,\r\nPhotoshop,\r\nPHP,\r\nTechnical Support,\r\nPhone Support,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development','<strong>Stretchtheskies.com</strong>','sts'),
	(11,'<strong>Artist Print and Production Graphics </strong> -\r\nHere is a sampling of some of the graphic print jobs I’ve done while working at Stretch The Skies and Transworld Entertainment, enjoy! (pdf format)<br>\r\n   <div style=\"text-align: left;\" align=\"center\">\r\n        <a href=\"http://finespunmusic.com/Oren/Projects/PK/Rais_Binder1.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/Rais_Binder1-1.jpg\" width=\"85\" height=\"110\" border=\"0\"></a>\r\n    </div><a href=\"http://finespunmusic.com/Oren/Projects/PK/Rais_Binder1.pdf\">Raistella</a>\r\n    <hr>\r\n\r\n    <div style=\"text-align: left;\" align=\"center\">\r\n        <a href=\"http://finespunmusic.com/Oren/Projects/PK/ElizabethWillsQuickSheet.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/ElizabethWillsQuickSheet.jpg\" width=\"81\" height=\"110\" border=\"0\"></a>\r\n    </div><a href=\"http://finespunmusic.com/Oren/Projects/PK/ElizabethWillsQuickSheet.pdf\">Elizabeth Wills</a>\r\n    <hr>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/PK/Golden_presskit.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/Golden_presskit-1.jpg\" width=\"85\" height=\"110\" border=\"0\"></a>\r\n\r\n\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/Golden_presskit.pdf\"><br>Golden M.C.</a>\r\n                <hr>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/SaraCoxBinder1.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/SaraCoxBinder1-1.jpg\" width=\"85\" height=\"110\" border=\"0\"></a>\r\n           \r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/SaraCoxBinder1.pdf\"><br><br>Sara Cox</a>\r\n                <hr>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/Zhinin_Binder1.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/Zhinin_Binder1-1.jpg\" width=\"84\" hei