         <a href=\"http://finespunmusic.com/Oren/Projects/PK/CJeff_OneSheet1.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/CJeff_OneSheet1.jpg\" width=\"86\" height=\"110\" border=\"0\"></a> <a href=\"http://finespunmusic.com/Oren/Projects/PK/CJeff_OneSheet1.pdf\"><br>C-Jeff</a>\r\n                <hr>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/Jmuse_Binder1.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/Jmuse_Binder1-1.jpg\" width=\"85\" height=\"110\" border=\"0\"></a> <a href=\"http://finespunmusic.com/Oren/Projects/PK/Jmuse_Binder1.pdf\"><br>Jmuse</a>\r\n                <hr>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/PK/RBIZ.pdf\"><img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/PK/thumbnails/RIBIZFact.gif\" width=\"86\" height=\"110\" border=\"0\"></a> <a href=\"http://finespunmusic.com/Oren/Projects/PK/RBIZ.pdf\"><br>Rbiz and Riddle</a>','All created in Adobe InDesign','<strong>Artist Print and Production Graphics</strong>','press'),
	(12,'<strong>Edene</strong> -\r\n<br>\r\n<p><strong><a href=\"http://finespunmusic.com/Oren/Projects/Sites/Kuda/HTML/Bio.htm\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Graphics/edeneSiteThumb.jpg\" width=\"110\" height=\"110\" border=\"0\"></a>Edene</strong> – This was a site for an artist known as Edene. Her site has since been removed from the web, so Ive reposted it in most of its entirety to my server. <a href=\"http://finespunmusic.com/Oren/Projects/Sites/Kuda/HTML/Bio.htm\" target=\"_blank\">Click to view</a></p>','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nPhotoshop,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development,','<strong>Edene</strong>','kuda'),
	(13,'<strong>F.Y.E. - For Your Entertainment, a Transworld Entertainment conglomerate of stores</strong> -\r\n<br><br>\r\n<strong>F.Y.E. .com Localeyez Independent Artists Store</strong>  My former company was&nbsp; the distributor for independent artists via Transworld Entertainment’s F.Y.E. Stores nationwide. I handled updating storefronts, placing artists into distribution, the Localeyez websites and more items listed in my resume. ','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nPhotoshop,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development,','F.Y.E.,Coconuts, The Wall, Suncoast Video and more','fye'),
	(14,'<strong>Finespunmusic.com</strong> -\r\n<br><br>\r\n<img class=\"alignleft\" style=\"border: 0px none;\" alt=\"Finespunmusic.com\" src=\"http://finespunmusic.com/Oren/Graphics/site1.jpg\" width=\"110\" height=\"110\" border=\"0\">Finespun was an all original rock&nbsp; band from 2000 through 2012 that I played in as well as doing all management, booking, promotion and writing for, as well as developing web content, web programming,&nbsp; mailing list fulfillment and social media networking for for those 12 years. There have been many faces to this and other Finespun websites as I would give it a facelift about every 2 years as members rotated in and out and new promotions and albums were released. I was also responsible for any print materials, apparel graphics, postering and signage for this act.','Audio,\r\nBranding,\r\nHTML/CSS,\r\nLogo Design,\r\nMSSQL,\r\nMySQL,\r\nPhoto,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development\r\n','<strong>Finespun</strong>','fs'),
	(15,'<strong>TandL Automatics</strong> -\r\n<br><br>\r\n\r\n\r\n<strong><a href=\"http://www.tandlautomatics.com/\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Graphics/TandLSiteThumb.jpg\" width=\"110\" height=\"110\" border=\"0\"></a>TandLAutomatics.com</strong> is a site I built while working for one of my former employers. The most of the graphics were done by Arika Mastin, my co-worker, and I implemented the coding and site design from there.<br>\r\n<a href=\"http://www.tandlautomatics.com/\" target=\"_blank\">Visit their site on the web here</a>','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nWeb,\r\nWeb Development','<strong>TandL Automatics</strong>','tl'),
	(16,'<strong>KnowGravity.com</strong> -\r\n<br>\r\n\r\n<strong><a href=\"http://finespunmusic.com/KG/KG/KG_bio.html\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"Know Gravity\" src=\"http://finespunmusic.com/Oren/Graphics/KG_th.png\" width=\"110\" height=\"110\" border=\"0\"></a>&nbsp; Know Gravity</strong> – A Local New York band who contracted me to build them a site quickly. Sadly, the project wasnt completley followed through on as the band went through a breakup in the middle of its creation. www.iknowgravity.com was the domain, but I have some of the working pieces posted locally <a href=\"http://finespunmusic.com/KG/KG/KG_bio.html\" target=\"_blank\">here</a>','PHP,\r\nMySQL,\r\nPhotoshop,\r\nLogo Design','<strong>Know Gravity</strong>','kg'),
	(17,'<strong>Hangovermd.net</strong> -\r\n<br>\r\n<strong><a href=\"http://hangovermd.net/\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Graphics/hangoverMDSiteThumb.jpg\" width=\"110\" height=\"110\" border=\"0\"></a>&nbsp; HangoverMD.net</strong> is a site I was contracted to build for a hangover cure. The site has since grossed over $500,000 worth of business as my contractor reports to me, but as of this writing is no longer&nbsp; available for you to visit on the web.','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nUser Interface,\r\nWeb,\r\nWeb Development','<strong>Hangover MD</strong>','hang'),
	(18,'<strong>Empire Pizza</strong> -\r\n<br>\r\n<strong><a href=\"http://empirepizzarochester.com/\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"Empire PIzza\" src=\"http://finespunmusic.com/Oren/Graphics/empirepizzaTh.png\" width=\"110\" height=\"110\" border=\"0\"></a>Empire Pizza</strong> – an old employer of mine came forward to ask for a quick website for his new business, i was more than happy to help out! <a href=\"http://empirepizzarochester.com/\">www.empirepizzarochester.com</a>','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nUser Interface,\r\nWeb,\r\nWeb Development','<strong>Empire Pizza</strong>','pizza'),
	(19,'CD Art and Design -\r\n  \r\n    Here is a sampling of some of the CD Design projects I’ve done in conjunction with my last job. Many logos and original art was created to suit the artist we worked for on a per project basis.\r\n<div class=\"col-md-8 col-md-offset-2\" >\r\n    <hr>\r\n    <img alt=\"Finespun\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/FinespunFinespun/cover1Thumb.gif\" width=\"110\" height=\"110\" longdesc=\"http://www.finespunmusic.com\" border=\"0\"> <p>Finespun – Self-Titled Debut – My band <a href=\"http://www.finespunmusic.com\">Finespun</a>‘s first release and one of my first computer graphics projects ever. File creation used a combination of Bryce,Photoshop,Poser and 3DSMax. The CD I had them on is getting old as the disc was released in 2001, heres pretty much all of it, via many errors from my 2008 CD/DVD Drive!<a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/FinespunFinespun/cover1.gif\"> Cover</a></p><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/FinespunFinespun/inlayNew.gif\">Inside Booklet</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/FinespunFinespun/backCover2Panel.gif\">Outside Booklet</a><br>\r\n   <p> CD Graphic – sadly unavailable, CD is old, see above!</p><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/FinespunFinespun/Tray.gif\">Tray Card</a> <a href=\"http://www.finespunmusic.com\" target=\"_blank\">If you like my bands art, check out our merch!</a>\r\n    <hr>\r\n    <img alt=\"Finespun\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_F4f.gif\" width=\"110\" height=\"110\" longdesc=\"http://www.finespunmusic.com\"> <p>Finespun – Digging Yourself Deeper – A full scale CD project once again for my band <a href=\"http://www.finespunmusic.com\">Finespun</a>‘s second CD entitled “Digging Yourself Deeper”…and boy did I! This puppy took hours upon hours to create and helped me master tons of great software. What you’re looking at are the proofs I got back from the duplication house that was handling the project, so you can see EXACTLY what went to press! The nifty part? The first panel of the inside booklet could be folded in reverse to form an alternate cover!</p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_F4f.pdf\">Cover and Outside Booklet</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_F4b.pdf\">Inside Booklet</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_CDF.pdf\">CD Graphic</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_INf.pdf\">Tray Card</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Digging/finespun_INb.pdf\">Under Clear Tray</a><p> this would later become our first T-shirt design </p><a href=\"http://www.finespunmusic.com\" target=\"_blank\">If you like my bands art, check out our merch!</a>\r\n    <hr>\r\n    <img alt=\"Finespun\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Bullet300DPICoverThumb.gif\" width=\"110\" height=\"110\"> <p>Finespun – Against the Fallout EP – A simple 1 panel insert with tray card and CD Face for my band </p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Bullet300DPICoverNonAni.gif\" target=\"_blank\">Finespun\'s 6 song EP sampler</a></p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Bullet300DPICoverNonAni.gif\">Cover</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Finespun_TrayCard.gif\">Tray Card</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Finespun/Finespun_CD_Face.gif\">CD Face</a> <a href=\"http://www.finespunmusic.com\" target=\"_blank\">If you like my bands art, check out our merch!</a>\r\n    <hr>\r\n    <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/FR/FR_CD_Thumb.gif\" width=\"110\" height=\"110\"><p> Farewell Redemption – The band is no longer together, but this remians one of my favorite textured backgrounds that I’ve made.</p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/FR/FrontFarewellRedemption.pdf\">Cover and back Inlay</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/FR/InsideFarewellRedemption.pdf\">Inside</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/FR/CD_Face.pdf\">CD Face</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/FR/tray-1up.pdf\">Tray Card</a>\r\n    <hr>\r\n    <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/VoodooJets/voodoo-jets-CDThumb.gif\" width=\"110\" height=\"110\"> <p>The Voodoo Jets (with former Steelheart drummer) – These nice guys wanted a huge multipanel production so thats what I gave em, they were more than happy.These are large files!<a href=\"http://finespunmusic.com/Oren/Projects/Graphics/VoodooJets/VoodooJetsBack.pdf\"><br>\r\n    Cover and back Inlay</a></p><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/VoodooJets/VoodooJetsInsideInlay.pdf\">Inside</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/VoodooJets/voodoo%20jets%20CD.pdf\">CD Face</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/VoodooJets/Voodoo%20Jets%20Tray.pdf\">Tray Card</a>\r\n    <hr>\r\n    <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/MillieCoverThumb.gif\" width=\"110\" height=\"110\" border=\"0\"> <p>Millie Manning – Kaleidescope – an interesting and challenging design to do<a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/4panel.pdf\">Cover and back Inlay</a></p><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/4panel2Blue.pdf\">Inside</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/Mille_4panel_Inside.pdf\">Inside Alternate Version</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/CD_Face.pdf\">CD Face</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/OuterTrayBlue.pdf\">Tray Card</a><br>\r\n    <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/MillieManning/UnderTray.pdf\">Under Clear Tray</a>\r\n    <hr>\r\n\r\n    <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/SecondCD/thumbnails/2PanelCoreyBrownFront2.jpg\" width=\"110\" height=\"109\" border=\"0\">\r\n\r\n                <p>Corey Brown aka Izril – came to me for his first CD Design. He provided us with a piece if printer paper with a drawing and handwritten notes and viola! His art was created… This section shows his second CD, his first CD is elsewhere on this page.</p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/SecondCD/2PanelCoreyBrownFront2.gif\">Cover</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/SecondCD/2PanelCoreyBrownBack2.gif\">Inside</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/SecondCD/CORY-BROWN-CD.gif\">CD Graphic</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/SecondCD/Corey-BrownTrayCard2.gif\">Tray Card</a>\r\n                <hr>\r\n                <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/FirstCD/CORY-BROWN-CDThumb.gif\"><p> Corey Brown aka Izril – Coreys First CD as referenced elsewhere on this page came to me in concept as some drawings on a sheet of paper with hand drawn notes and arrows. Anything can be accomplished!</p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/FirstCD/2PanelCoreyBrownFront.gif\">Cover</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/FirstCD/2PanelCoreyBrownBack.gif\">Inside</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/FirstCD/CORY-BROWN-CD.gif\">CD Graphic</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/CoreyBrown/FirstCD/Corey-BrownTrayCard.gif\">Tray Card</a>\r\n                <hr>\r\n                <img alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Graphics/Lyvonte/InfamousInsert-1Thumb.gif\" width=\"110\" height=\"110\"><p> Infamous – Amazing what one can do when provided with high quality pictures!</p><a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Lyvonte/InfamousInsert.pdf\">Cover (Front and Back)</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Lyvonte/InfamousCDR.pdf\">CD Face</a><br>\r\n                <a href=\"http://finespunmusic.com/Oren/Projects/Graphics/Lyvonte/InfamousTray.pdf\">Tray Card</a>\r\n                <hr>\r\n    </div>        \r\n\r\n','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nUser Interface,\r\nWeb,\r\nWeb Development','<strong>CD Art</strong>','cd'),
	(20,'<strong>Pepp Network</strong> -\r\n<br>\r\nContracted by Applied Computer Technologies to build a new home for Pepp Network to bring its site up to date with new technology!	','Branding,\r\nHTML/CSS,\r\nLogo Design,\r\nPHP,\r\nUser Interface,\r\nWeb,\r\nWeb Development,\r\nWordpress','<strong>Pepp Network</strong>','pepp'),
	(21,'<strong>Beattrader.com</strong> -\r\n<br>\r\n<p><strong><a href=\"http://finespunmusic.com/Oren/Projects/Sites/BeatTrader/BeatHTML/indexF.htm\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Sites/BeatTrader/BeattraderSiteThumb.gif\" width=\"110\" height=\"110\" border=\"0\"></a>Beattrader.com</strong> – I got contracted by a fellow to build a site which would end up being an auction site for artists to buy, sell and auction their hip hop beats on. I grabbed a simple auction script from the web and modified the heck out of itto suit the customers needs. Before the project was complete, the customer disappeared and I never got fully paid for this site. The site itself was written and modified in Perl. Its a shame because it was a fully functional auction site with PayPal payments, login scripts, user accts and more and worked really nicely when I was finished. Since the customer disappeared he let his domain name lapse and someone else bought it, so none of my absolute linking works anymore and in turn, I have just posted the homepage to my server so you can get a feel for what the site would do. I still have the site in its entirety, so if you’re in need of an auction site, I can relink and re-customize this to suit your project, just contact me and we can begin!<br>\r\n<a href=\"http://finespunmusic.com/Oren/Projects/Sites/BeatTrader/BeatHTML/indexF.htm\" target=\"_blank\">Click to view partial (unfortunatley) site</a></p>			\r\n				','Audio,\r\nBranding,\r\nHTML/CSS,\r\nLogo Design,\r\nMSSQL,\r\nMySQL,\r\nPhoto,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development','<strong>Beattrader.com</strong>','beat'),
	(22,'<strong>ThankYouStanley.com</strong> -\r\n<br>\r\nA One page lander commisioned by a local Brooklyn film Company. Im a fan of chrome, so I just like the way it looks!		\r\n								\r\n','HTML','<strong>ThankYouStanley.com</strong>','stanley'),
	(23,'<strong>Home and Garden Designers</strong> -\r\n<br>\r\n<a href=\"http://finespunmusic.com/Oren/Projects/Sites/Jess/index_orig.html\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Graphics/homeandgardenSitethumb.jpg\" width=\"110\" height=\"110\" border=\"0\"></a>&nbsp; This site was for a candle reseller company known as<strong> Home and Garden Designers</strong>. Financial difficulty led to the closing of the business and hence led to a landing page being put up at <a href=\"http://finespunmusic.com/Oren/HTML/www.homeandgardendesigners.com\" target=\"_blank\">www.homeandgardendesigners.com</a> . I have posted the working site on my server for you to view, careful, the buy buttons work but if you use them you wont get any product or your money back as the company is no longer in business!&nbsp; <a href=\"http://finespunmusic.com/Oren/Projects/Sites/Jess/index_orig.html\" target=\"_blank\">Click to view entire site</a>','HTML','<strong>Home and Garden Designers</strong>','jess'),
	(24,'<strong>Home and Garden Designers</strong> -\r\n<br>\r\n<strong><a href=\"http://finespunmusic.com/Oren/Projects/Sites/AshleeGarriton/index.htm\" target=\"_blank\"><img class=\"alignleft\" style=\"border: 0px none;\" alt=\"\" src=\"http://finespunmusic.com/Oren/Projects/Sites/AshleeGarriton/AshleeSiteThumb.gif\" width=\"110\" height=\"110\" border=\"0\"></a>&nbsp; Ashlee Garriton.com</strong> A gorgeous (except for the artist wanting a repeating background of a picture that didnt lend itself to one in my opinion!) site in green done for artist Ashlee Garriton, an artist who decided to go back to school and stop pursuing her music as a career. I love the site and you will too. Its posted to my server now for your viewing pleasure! (plays music, be careful while at work!)<br>\r\n<a href=\"http://finespunmusic.com/Oren/Projects/Sites/AshleeGarriton/index.htm\" target=\"_blank\">Click to view entire site</a>','Audio,\r\nBranding,\r\nHTML/CSS,\r\nLogo Design,\r\nMSSQL,\r\nMySQL,\r\nPhoto,\r\nUser Interface,\r\nVideo,\r\nWeb,\r\nWeb Development','<strong>Ashlee Garriton</strong>','ash'),
	(25,'<strong>Dart - Diretcnic.com\'s Support Portal</strong> - I designed the new dashboard for the DART PORTAL during my time at Directnic.com\r\n','Bootstrap 3, Gumby CSS, Lots of jQuery, Lots of Ajax!','<strong>DART</strong>','dart');
